// basic import
import React from 'react';
import ReactDOM from 'react-dom';

//import font

//import style
import 'bootstrap/dist/css/bootstrap.min.css';
import './style/template.css'
import './style/Homepage.css'
//only index need to inport style and font


import Header from './components/Header';


import Main from './view/Homepage';
import About from './view/About';
import CardList from './view/CardList';
import Rule from './view/Rule';
import Game from './view/Game';

import {
  BrowserRouter as Router,
  Route,
  Switch,
  Redirect,
} from "react-router-dom";


class App extends React.Component{
	render(){
		return (
		<Router>

			<div className='body'>
				<Header />
					<Switch>
						<Route path ='/' exact component = {Main}/>
						<Route path ='/about' component = {About}/>
						<Route path ='/cl' component = {CardList}/>
						<Route path ='/rule' component = {Rule}/>

						<Redirect from="/setup" to="/setup/player" />
						<Route path ='/setup/player' component = {Game}/>

						<Route component = {NotFound} />
					</Switch>

			</div>
		</Router>
		)
	}
}

class NotFound extends React.Component{
	render(){
		return (
			<div className = 'body fail'>
				<h1>
					LINK NOT FOUND
				</h1>
			</div>
			)
	}
}


ReactDOM.render(
  <App />,
  document.getElementById('root')
);
